1) PROMOVER  OBRAS Y SERVICIOS EN FAVOR DEL DESARROLLO Y ACTUALIZACIÓN DE LOS VALORES CULTURALES DEL PUEBLO VASCO PARA CONTRIBUIR CON ESOS LOGROS CULTURALES A QUE LA IGLESIA PUEDA CUMPLIR MEJOR SU MISIÓN EVANGELIZADORA EN SERVICIO DE LOS HOMBRES.&#13;
&#13;
2) LA PRESTACIÓN DE SERVICIOS DE ASESORAMIENTO Y ESTUDIO DE TODO TIPO DE EMPRESAS E INSTITUCIONES, BIEN SEAN PERSONAS INDIVIDUALES O JURÍDICAS, PÚBLICAS Y PRIVADAS, EN MATERIAS RELACIONADAS CON LA LENGUA Y LA CULTURA VASCAS Y CUALQUIER OTRO TIOP O DE ASESORAMIENTO O GESTIÓN QUE SE DEMANDE.&#13;
&#13;
3) LA INVESTIGACIÓN, ESTUDIO Y PLANIFICACIÓN DE PROYECTOS,  MEMORIAS E INFORMES EN LOS CAMPOS DE ACTIVIDAD EXPRESADOS.&#13;
&#13;
4) EL DESARROLLO DE ESTUDIOS RELIGIOSOS, LINGÜÍSTICOS, PEDAGÓGICOS, LITERARIOS, SOCIOLÓGICOS, HISTÓRICOS, ETNOGRÁFICOS, ETNOLÓGICOS Y DE OTRA NATURALEZA DE ÁMBITO LOCAL, PROVINCIAL, AUTONÓMICO, ESTATAL O EXTRANJERO.&#13;
&#13;
5) EL INSTITUTO FINALMENTE PODRÁ REALIZAR TODO CUANTO SEA ANTECEDENTE, COMPLEMENTO O CONSECUENCIA DE LO EXPUESTO
